import React from 'react';
import Markdown from './Markdown';
import { Paper } from '@material-ui/core';

const BlogDetail = (props) => {

    const { post } = props;

    return (
        <React.Fragment>
            <Container>
                <Paper>
                    <Markdown key={post.id}>
                        {post.content}
                    </Markdown>
                </Paper>
            </Container>
        </React.Fragment>
    )
}
export default BlogDetail;
